import { createSlice, createAsyncThunk } from "@reduxjs/toolkit";

export const getProducts = createAsyncThunk('product/getProducts', async(_, thunkAPI) => {
    const {rejectWithValue} = thunkAPI
    try{
        const res = await fetch ("http://localhost:3005/product")
        const data = await res.json()
        return data;

    }catch(error) {
        return rejectWithValue(error.message)
    }

})
export const getUsers = createAsyncThunk('product/getUsers', async(_, thunkAPI) => {
    const {rejectWithValue} = thunkAPI
    try{
        const res = await fetch ("http://localhost:3005/user")
        const data = await res.json()
        return data;

    }catch(error) {
        return rejectWithValue(error.message)
    }

})
export const insertUser = createAsyncThunk("product/insertUser" , async (dataUser , thunkAPI) => {
    const {rejectWithValue, getState} = thunkAPI
    try{
      console.log(dataUser)
        dataUser.name = getState().auth.name
        dataUser.email = getState().auth.email
        dataUser.password = getState().auth.password
        const res = await fetch("http://localhost:3005/user", {
            method:'POST',
            body : JSON.stringify(dataUser),
            headers: {
                'Content-type': 'application/json; charset=UTF-8'
            },
        })
        const data = await res.json()
        return data;

    }catch(error){
        return rejectWithValue(error.message)

    }
    
})
export const getCart = createAsyncThunk('product/getCart', async(_, thunkAPI) => {
    const {rejectWithValue} = thunkAPI
    try{
      
        const res = await fetch ("http://localhost:3005/cart")
        const data = await res.json()
        return data;

    }catch(error) {
        return rejectWithValue(error.message)
    }

})
export const addToCart = createAsyncThunk("product/addToCart" , async (productInfo , thunkAPI) => {
    const {rejectWithValue, getState} = thunkAPI
    try{
      
      const userId = getState().product.login.userId;
      const productToSend = {
        id: productInfo.id,
        title: productInfo.title,
        price: productInfo.price,
        image: productInfo.image,
        category: productInfo.category,
        userId, // attach user
      };
        const res = await fetch("http://localhost:3005/cart", {
            method:'POST',
            body : JSON.stringify(productToSend),
            headers: {
                'Content-type': 'application/json; charset=UTF-8'
            },
        })
        const data = await res.json()
        console.log(data)
        return data;

    }catch(error){
        return rejectWithValue(error.message)

    }
    
})

const ProductSlice = createSlice({
  name: "product",
  initialState: {
    products: [],
    filteredProducts: [],
    cart: [],
    users:[],
    login:{status:false,userId:""},
  },
  reducers: {
    dataFilter: (state, action) => {
      if (action.payload === "All") {
        state.filteredProducts = state.products;
      } else {
        if(state.products){
          state.filteredProducts = state.products.filter(
          (el) => el.category === action.payload
        );
        }
      }
    },
    // addToCart: (state, action) => {
    //   const product = state.products.find(el => el.id === action.payload);
    //   if (product) {
    //     const exist = state.cart.find(el => el.id === product.id);
    //     if (exist) {
    //       exist.quantity += 1;
    //     } else {
    //       state.cart.push({ ...product, quantity: 1 });
    //     }
    //   }
    // },
    incrementQty: (state, action) => {
      const item = state.cart.find(el => el.id === action.payload);
      if (item) item.quantity += 1;
    },
    decrementQty: (state, action) => {
      const item = state.cart.find(el => el.id === action.payload);
      if (item && item.quantity > 1) item.quantity -= 1;
    },
    addUser:(state,action)=>{
      state.users.push(action.payload)
    },
    logIn :(state,action)=>{
      state.login.status = true
      state.login.userId = action.payload
    }
  },
  extraReducers: (builder) => {
    builder
      .addCase(getProducts.pending, (state) => {
        console.log("pending")
      })
      .addCase(getProducts.fulfilled, (state, action) => {
        state.products = action.payload;
        state.filteredProducts = action.payload;
        console.log("fullfiled")
      })
      .addCase(getProducts.rejected, (state, action) => {
      })
      .addCase(getUsers.pending, (state, action) => {
        console.log("pending")
      })
      .addCase(getUsers.fulfilled, (state, action) => {
        state.users = action.payload;
        console.log("fullfiled")

      })
      .addCase(getUsers.rejected, (state, action) => {
        console.log("rejected")
      })
      .addCase(getCart.pending, (state, action) => {
        console.log("pending")
      })
      .addCase(getCart.fulfilled, (state, action) => {
        state.cart = action.payload;
        console.log("fullfiled")

      })
      .addCase(getCart.rejected, (state, action) => {
        console.log("rejected")
      })
      .addCase(addToCart.pending, (state, action) => {
        console.log("pending")
      })
      .addCase(addToCart.fulfilled, (state, action) => {
        state.cart.push( action.payload);
        console.log("fullfiled")

      })
      .addCase(addToCart.rejected, (state, action) => {
        console.log("rejected")
      })
  }
});

export const { dataFilter, incrementQty, decrementQty,addUser,logIn } = ProductSlice.actions;
export default ProductSlice.reducer;
